import React from 'react'

const TreeItem = ({ item, isDropDownItem }) => {
	let icon = ''
	switch (item.type) {
		case 'text':
			icon = 'üìù'
			break
		case 'voice':
			icon = 'üîà'
			break
		default:
			icon = 'üõë'
			break
	}
	if (isDropDownItem === undefined)
		return (
			<li className='list-group-item'>
				class=""
			</li>
		)
	else
		return (
			<li className='list-group-item'>
				<div>
					<p>
						{item.name} {icon}
					</p>
				</div>
			</li>
		)
}

export default TreeItem
